 // draw a circle, set the lineStyle to zero so the circle doesn't have an outline\n            graphics.lineStyle(0);\n            graphics.beginFill(0xffff0b, 0.5);\n            graphics.drawCircle(470, 90, 60);\n            graphics.endFill();\n        }\n    }\n}\n\n    \n\n    \n        \n  example-graphicswrapper works!\n\n\n    \n\n    \n        \n        \n            \n                Legend\n            \n            \n                Html element\n            \n            \n                Component\n            \n            \n                Html element with directive\n            \n        \n    \n\n\n\n\n\n\n        var COMPONENT_TEMPLATE = '  example-graphicswrapper works!'\n    var COMPONENTS = [{'name': 'AppComponent', 'selector': 'app-root'},{'name': 'Example1Component', 'selector': 'example1'},{'name': 'Example2Component', 'selector': 'example2'},{'name': 'Example3Component', 'selector': 'example3'},{'name': 'Example4Component', 'selector': 'example4'},{'name': 'Example5Component', 'selector': 'example5'},{'name': 'Example6Component', 'selector': 'example6'},{'name': 'ExampleGraphicswrapperComponent', 'selector': 'example-graphicswrapper'},{'name': 'PixiApplicationComponent', 'selector': 'pixi-application'},{'name': 'PixiContainerComponent', 'selector': 'pixi-container'},{'name': 'PixiGraphicsComponent', 'selector': 'pixi-graphics'},{'name': 'PixiGraphicsWrapperComponent', 'selector': 'pixi-graphicswrapper'},{'name': 'PixiInitializerComponent', 'selector': 'pixi-initializer'},{'name': 'PixiLayerComponent', 'selector': 'pixi-layer'},{'name': 'PixiSpriteComponent', 'selector': 'pixi-sprite'},{'name': 'PixiTextComponent', 'selector': 'pixi-text'}];\n    var DIRECTIVES = [{'name': 'PixiGraphicswrapperDirective', 'selector': '[pixi-graphicswrapper]'},{'name': 'PixiInitializerDirective', 'selector': '[pixi-initializer]'}];\n    var ACTUAL_COMPONENT = {'name': 'ExampleGraphicswrapperComponent'};\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n  